  ,MILEAGE_RATE           NUMERIC(6,4) NOT NULL
  ,ANNUAL_MAINT           NUMERIC(10,0) NOT NULL
  ,DAILY_REPLACEMENT      NUMERIC(10,2) NOT NULL
  ,DAILY_ECON_COST        NUMERIC(10,2) NOT NULL
  ,DAILY_MAINTENANCE_COST NUMERIC(10,2) NOT NULL
  ,DAILY_CAR_HIRE_COST    NUMERIC(10,2) NOT NULL
  ,DAILY_EQUIPMENT_COST   NUMERIC(10,2) NOT NULL
